// Import the React and ReactDOM libraries
import React from 'react';
import ReactDOM from 'react-dom';

// Create a react component
const App = () => {


  return (
    <div style={{
      backgroundImage: `url("c.jpg")`,

      position: 'absolute',
      width: '100vw',
      height: '100vh'
      //backgroundImage: "url(${headerImg})"backgroundColor: "#ffe063"
    }}>

      <h2 style={{
        textAlign: "center", color: "#baa7d9"
      }}>Hello, I'm  Kulikova Dariia</h2>
      <a href="https://www.linkedin.com/in/dariia-kulikova-6b48ab172">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="Linkedin.png" />
        LinkedIn
      </a>

      <a href="https://github.com/dariiakulik">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="github.png" />
        Github
      </a>

      <a href="https://resume.io/r/zeT2qZVHx">
        <img style={{
          width: "30px",
          margin: "30px auto"
        }}
          src="cv.jpeg" />
       CV
      </a>
      <a href="" style={{
        textDecoration: "none",
        outline: "none",
        display: "inline-block",
        color: "white",
        padding: "20px 30px",
        margin: "10px 20px",
        borderRadius: "10px",
        fontFamily: "Montserrat, sans-serif",
        textTransform: "uppercase",
        letterSpacing: "2px",
        backgroundImage: "linear-gradient(to right, #9EEFE1 0%, #4830F0 51%, #9EEFE1 100%)",
        backgroundSize: "200% auto",
        boxShadow: "0 0 20px rgba(0,0,0,.1)",
        transition: ".5s"
      }} hover={{ backgroundPosition: "right center" }}>Button</a>

    </div >
  );
};

// Take the react component and show it on the screen
ReactDOM.render(<App />, document.querySelector('#root'));
